import React from 'react';
import logo from './logo.svg';
import './App.css';

function purchase(){
  fetch("http://locahost:8080/v1/purchase", {
    method: 'POST',
    headers: {
      'Accept': 'application/json',
      'Content-Type': 'application/json',
    },
    body: JSON.stringify({
      itemList: [],
      location: 'CA',
    })
  }).then(
    res => res.json()).then(result => {
      console.log(result);
    })
};


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <button onClick={() => purchase()}>Purchase</button>
      </header>
    </div>
  );
}

export default App;
